import './App.css';

export default function AuthForm() {
    return (
        <>  
        <div className="title">
            <Text style={styles.title-text}>City Jail Information Center</Text>
        </div>
        </>
    );
}

const styles = StyleSheet.create({
    baseText: {
      fontFamily: 'Cochin',
    },
    titleText: {
      fontSize: 20,
      fontWeight: 'bold',
    },
  });
